snippet.textDisplay:
Quanto mais sensível um teste, maior a probabilidade dele ser verdadeiro positivo (ou menor a probabilidade de ser falso negativo, se preferir);

E quanto mais específico o exame, maior a probabilidade dele ser negativo em quem não tem a doença. 


Sensibilidade identifica os doentes, especificado identifica o grupo dos não doentes. Ou seja, quanto mais específico um teste, menor a probabilidade de o resultado negativo ser falso.

